function updatePass() {
  const pid = document.getElementById("passval").value;
  const months = Array.from(document.querySelectorAll(".månad:checked")).map(e => parseInt(e.value));

  let total = 0, unika = new Set();
  let kön = {}, ålder = {}, medlemskap = {};

  for (const m of months) {
    const d = monthly[pid][m];
    if (!d) continue;
    total += d.antal_besok;
    Object.keys(d.Kön).forEach(k => kön[k] = (kön[k] || 0) + d.Kön[k]);
    Object.keys(d.Åldersgrupp).forEach(k => ålder[k] = (ålder[k] || 0) + d.Åldersgrupp[k]);
    Object.keys(d.Medlemskap).forEach(k => medlemskap[k] = (medlemskap[k] || 0) + d.Medlemskap[k]);
  }

  // För unika: summera unika deltagare från metadata i snitt
  let unika_est = Math.round(passmeta[pid].unika_personer * months.length / 12);
  let per_week = (total / 52).toFixed(1);

  document.getElementById("info").innerHTML = `
    <div class='infobox'>📌 <strong>${passmeta[pid].Passnamn}</strong></div>
    <div class='infobox'>👥 <strong>${total}</strong> besök</div>
    <div class='infobox'>🧍 <strong>${unika_est}</strong> unika deltagare (est)</div>
    <div class='infobox'>📅 <strong>${per_week}</strong> i snitt/vecka</div>
  `;

  function drawPie(div, values, title) {
    Plotly.newPlot(div, [{
      values: Object.values(values),
      labels: Object.keys(values),
      type: "pie",
      textinfo: "label+percent",
      hole: .3
    }], {
      title: title
    });
  }

  drawPie("kon", kön, "Kön");
  drawPie("aldersgrupp", ålder, "Åldersgrupp");
  drawPie("medlemskap", medlemskap, "Medlemskap");
}

document.getElementById("passval").addEventListener("change", updatePass);
document.querySelectorAll(".månad").forEach(cb => cb.addEventListener("change", updatePass));

updatePass();
</script>
